  return (
    <div className="bg-slate-600">
      <div className="text-red-700 font-semibold text-center text-4xl">FAQ</div>
      <div className="space-y-5">
        <SingleQuestionItem />
        <SingleQuestionItem />
        <SingleQuestionItem />
        <SingleQuestionItem />
      </div>
      {asked_questions.map((question) => {
        return <SingleQuestionItem qa={question} />;
      })}
    </div>
  );
};

export default Faq;
